import React, { Component } from 'react'
import Info from './Info/Info'
import  './Body.css'


class Body extends Component{
    state={
        covidvalue:{
            "Tested_positive":36456,
        "Tested_negative":621654,
        "Tested_total":658110,
        "In_isolation":16019,
        "Quarantined":8939,
        "Tested_rdt":312402,
        "Pending_result":0,
        "Recovered":20242,
        "Deaths":195
    }
    };

    render(){
        let printinfo=""
        Object.keys(this.state.covidvalue).map((key, i) => (
           printinfo[i]=<Info key={i} type="info" number={this.state.covidvalue[key]} title={key}/>
          )
        )
       return(
        <div className="body">
            <div className="row">
                {printinfo}
            <Info type="info" number="2000" title="Total deaths"/>
            <Info type="danger" number="2000" title="Total deaths"/>
            <Info type="success" number="2000" title="Total deaths"/>
            <Info type="warning" number="2000" title="Total deaths"/>
            <Info type="info" number="2000" title="Total deaths"/>

            </div>
        </div>
        )
    }
}

export default Body
